func TestDigest(t *testing.T) {
	for _, test := range digesttests {
		v, a, b := Digest(test.sequence, test.enzyme)
		for i := 0; i < len(v); i++ {
			if v[i] != test.Finalfragments[i] {
				fmt.Println("\x1b[31;1m", v, "\x1b[0m", "\n")
				t.Error(
					"For", test.sequence, "\n",
					"and", test.enzyme, "\n",
					"expected", test.Finalfragments[i], "\n",
					"got", v[i], "\n",
				)
			}
		}
		for i := 0; i < len(a); i++ {
			if a[i] != test.Stickyends_5prime[i] {
				fmt.Println("\x1b[33;1m", a, "\x1b[0m", "\n")
				t.Error(
					"For", test.sequence, "\n",
					"and", test.enzyme, "\n",
					"expected", test.Stickyends_5prime[i], "\n",
					"got", a[i], "\n",
				)
			}
		}
		for i := 0; i < len(b); i++ {
			if b[i] != test.Stickyends_3prime[i] {
				fmt.Println("\x1b[34;1m", b, "\x1b[0m", "\n")
				t.Error(
					"For", test.sequence, "\n",
					"and", test.enzyme, "\n",
					"expected", test.Stickyends_3prime[i], "\n",
					"got", b[i], "\n",
				)
			}
		}
	}
}

// simple reverse complement check to test testing methodology initially
type testsequence struct {
	sequence string
	revcomp  string
}

var sequences = []testsequence{
	{"ATG", "CAT"},
	{"YNB", "VNR"},
}

func TestRevComp(t *testing.T) {
	for _, sequence := range sequences {
		r := RevComp(sequence.sequence)
		if r != sequence.revcomp {
			t.Error(
				"For", sequence.sequence, "/n",
				"expected", sequence.revcomp, "\n",
				"got", r, "\n",
			)
		}
	}

}

func TestMakedoublestrandedDNA(t *testing.T) {
	for _, sequence := range digesttests {
		r := MakedoublestrandedDNA(sequence.sequence)
		//startseqUpper := strings.ToUpper(sequence.doublestranded.Seq)
		for i := 0; i < len(r); i++ {
			if r[i] != sequence.doublestranded[i] {
				t.Error(
					"For", sequence.sequence, "\n",
					"expected", sequence.doublestranded[i], "\n",
					"got", r[i], "\n",
				)
			}
		}
	}
}

